                        </Modal.Footer>
                      </Modal>
                    </div>
                  </Modal.Body>
                  <Modal.Footer>
                    {uid_dis}
                    {mod_dis}
                    <Button variant="secondary" onClick={handleClose}> Close </Button>
                  </Modal.Footer>
                </Modal>
                <Modal show={upuid} onHide={upuidClose}>
