                    </Button>
                  </Modal.Footer>
                </Modal>
                <Modal show={modify} onHide={modifyClose}>
                  <Modal.Header closeButton>
                    <Modal.Title>Modify UID: {uid}</Modal.Title>
                  </Modal.Header>
                  <Modal.Body>
                    {ModifyInfo}
                  </Modal.Body>
